webpackJsonp([0x7ccf1663d3c6],{989:function(t,a){t.exports={data:{markdownRemark:{html:'<p>Andy Carvin, director of the Digital Divide Network, recently posted a fascinating, heartbreaking perspective just how much damage has been done. He found the images at a strange condo site, <a href="http://katrina05.blogspot.com/">condobuzz.com</a>. The images are overlays of the flooding with other metropolitan areas. (Note this is <em>just the flooding</em>. The hurricane damages, if in the midwest, would reach from Detroit to Chicago.) Andy\'s excellent, popular, collaborative Katrina blog is here:\n<a href="http://katrina05.blogspot.com/">http://katrina05.blogspot.com/</a></p>\n<p>Below are Washington and Winston-Salem, NC. (My native state.) Click to enlarge. </p>\n<img alt="washingtondc-flood-map" src="/static/images/washingtondc-flood-map-thumb.jpg" />\n<img alt="winstonsalem-flood-map" src="/static/images/winstonsalem-flood-map-thumb.jpg" />',frontmatter:{created_at:"September 10, 2005",path:"/2005/09/10/what-if-the-flood-was-in-washington",title:"What if the Flood Was in Washington?",tags:["DDN","nc","katrina"]}}},pathContext:{}}}});
